const m = require('zigbee-herdsman-converters/lib/modernExtend');

function genEnumForEndpoint(epName) {
  return [
    m.enumLookup({
      endpointName: epName,
      name: "switch_mode",
      lookup: {toggle: 0, momentary: 1, multifunction: 2},
      cluster: "genOnOffSwitchCfg",
      attribute: {ID: 0x4000, type: 0x30},
      description: "Switch Mode",
    }),
    m.enumLookup({
      endpointName: epName,
      name: "switch_actions",
      lookup: {on_off: 0, off_on: 1, toggle: 2},
      cluster: "genOnOffSwitchCfg",
      attribute: "switchActions",
      description: "Actions switch",
    }),
    m.enumLookup({
      endpointName: epName,
      name: "backlight_mode",
      lookup: {on: 0, off: 1, onoff: 2, offon: 3},
      cluster: "genOnOff",
      attribute: {ID: 0x4101, type: 0x30},
      description: "Backlight Mode",
    }),
  ]
}

function genExtend(endpoints) {
  let endpointNames = Object.keys(endpoints);
  let features = [
    m.deviceEndpoints({"endpoints": endpoints}), 
    m.onOff({"powerOnBehavior": true,"endpointNames": endpointNames}), 
    m.commandsOnOff({"endpointNames": endpointNames}), 
    m.commandsLevelCtrl({"endpointNames": endpointNames}),
  ];
  for (let i = 0; i < endpointNames.length; i++) {
    features.push(...genEnumForEndpoint(endpointNames[i]));
  }
  
  return features;
}

const definitions = [
  {
    zigbeeModel: ['ZS-EUB2'],
    model: 'ZS-EUB2',
    vendor: 'Moes',
    description: 'SmartSwitch 2-Gang',
    extend: genExtend({"left":1,"right":2}),
    meta: {multiEndpoint: true},
    ota: true,
    icon: 'data:image/png;base64,',
  },
  {
    zigbeeModel: ['ZS-EUB3'],
    model: 'ZS-EUB3',
    vendor: 'Moes',
    description: 'SmartSwitch 3-Gang',
    extend: genExtend({"left":1,"right":2, "center": 3}),
    meta: {multiEndpoint: true},
    ota: true,
    icon: 'data:image/png;base64,',
  }
];

module.exports = definitions;
